// ----------------- 读写辅助函数 -----------------
static inline void set_block(int x, int y, int z, uint8_t blk) {
    if ((unsigned)x >= MAPSIZE || (unsigned)y >= MAPSIZE || (unsigned)z >= MAPSIZE) return;
    int zi = z / 2;
    uint8_t shift = (z & 1) ? 4 : 0;
    uint8_t mask = 0xF << shift;
    MAP[x][y][zi] = (MAP[x][y][zi] & ~mask) | ((blk & 0xF) << shift);
}
static inline uint8_t get_block(int x, int y, int z) {
    if ((unsigned)x >= MAPSIZE || (unsigned)y >= MAPSIZE || (unsigned)z >= MAPSIZE) return;
    int zi = z / 2;
    uint8_t shift = (z & 1) ? 4 : 0;
    return (MAP[x][y][zi] >> shift) & 0xF;
}

